import Sidebar from "../Sidebar/Sidebar";
import Chart1 from "../Chart1";
import Chart2 from "../Chart2";
import Widget1 from "../Widget1";
import Widget2 from "../Widget2";
import Widget3 from "../Widget3";
import Widget4 from "../Widget4";
import Widget5 from "../Widget5";



const data = {
  labels: [],
  datasets: [
    {
      label: "en millions d'euros",
      data: [],
      borderColor: "white",
    },
  ],
};
const dataBaton = {
  labels: [
    "AUVERGNE/RHONE-ALPES",
    "BOURGOGNE / FRANCHE-COMTE",
    "BRETAGNE",
    "CENTRE-VAL DE LOIRE",
    "CORSE",
    "GRAND EST",
    "HAUTS DE FRANCE",
    "ILE-DE-FRANCE",
    "NORMANDIE",
    "NOUVELLE AQUITAINE",
    "OCCITANIE",
    "PAYS DE LA LOIRE",
    "PROVENCE-ALPES-COTE D AZUR",
  ],
  datasets: [
    {
      label: "par ville",
      data: [],
      backgroundcolor: "white",
    },
  ],
};

let annee = [];
let entrees_millions = [];
let villes = [
  "AUVERGNE+%2F+RHONE-ALPES",
  "BOURGOGNE+%2F+FRANCHE-COMTE",
  "BRETAGNE",
  "CENTRE-VAL+DE+LOIRE",
  "CORSE",
  "GRAND+EST",
  "HAUTS+DE+FRANCE",
  "ILE-DE-FRANCE",
  "NORMANDIE",
  "NOUVELLE+AQUITAINE",
  "OCCITANIE",
  "PAYS+DE+LA+LOIRE",
  "PROVENCE-ALPES-COTE+D%27AZUR",
];
let cinemas = [];


class Home extends React.Component {
  render(){

    return (
      <Box className="body">
        <div className="container">
          <Sidebar />

          <Box component="main" sx={{ flexGrow: 1, bgcolor: "#212427", p: 3 }}>
          <center><h1>Dashboard cinema </h1></center>
            <Grid container spacing={1} className="firstcard">

              <Grid item xs={4}>

                <Widget1/>

              </Grid>
              <Grid item xs={4}>

                <Widget2/>

              </Grid>
              <Grid item xs={4}>

                <Widget3/>

              </Grid>
              <Grid item xs={6}>

                  <Chart1/>

              </Grid>
              <Grid item xs={6}>

                <Chart2/>

              </Grid>
              <Grid item xs={7}>
                <div className="graphcard">Genre/Age des visiteurs</div>
              </Grid>
              <Grid item xs={5}>

                <Widget4/>
                <br /> <br />
                <Widget5/>

              </Grid>
            </Grid>
          </Box>
        </div>
      </Box>
    );
  }
}

export default Home;
